#include <bits/stdc++.h>using namespace std; #define int long long int#define endl '\n'#define all(x) x.begin(), x.end() void solve(){    int n, k; cin >> n >> k;    set<int> s;    for(int i = 0; i < n; i++){        int x; cin >> x;        s.insert(x);    }     map<int, bool> mp;    set<int> ans;    while(!s.empty()){        int x = *s.begin();        if(mp[x]){            s.erase(x);        }        else{            for(int i = x; i <= k; i += x){                if(s.count(i)) mp[i] = true;                else{                    cout << -1 << '\n';                    return;                }                ans.insert(x);                s.erase(x);            }        }    }    cout << ans.size() << '\n';    for(auto x : ans) cout << x << " "; cout << '\n';} int32_t main(){    ios_base::sync_with_stdio(0);    cin.tie(0);    int t = 1;    cin >> t;    while (t--)        solve();    return 0;}